import React from 'react'
import {
    BrowserRouter as Router,
    Route,
    Link
  } from "react-router-dom";

function Login() {
    return (
        <div>
            <div class="parallax-container targetTopo">
                <div class="parallax corPadrao">
                    <div class="container">
                        <Link to="/">
                            <i class="material-icons left medium white-text">chevron_left</i>
                        </Link>
                        <h2 style={{ color: '#fff' }}>Dados da empresa</h2>
                    </div>
                </div>
            </div>



        </div>
    )
}

export default Login
